import React from "react";

class Paragraph extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      message: "He conseguido hacer funcionar el state",
    };
  }
  render() {
    return (
      <div>
        <p className="paragraph">{this.props.content}</p>
      </div>
    );
  }
}

Paragraph.propTypes = {};
export default Paragraph;
